  //   .get();

  // useEffect(() => { 
  // }, []);
  // console.log(aboutTitle);

  return (
    <>
      <AboutProvider>
        <Router>
          <NavBar name="Lauren Wright" links={routeData} />
          <Switch>
            <Route path="/" exact component={Home}>
            </Route>
            <Route path="/about" component={About}>
            </Route>
            <Route path="/blogs" component={Blogs}>
            </Route>
          </Switch>
        </Router>
      </AboutProvider>
    </>
  );
}
